import { useState } from "react";
import "./App.css";

function App() {
      const [freeSpaces, setFreeSpaces] = useState({
            1: 20,
            2: 20,
            3: 20,
      });

      const [id, setId] = useState(0)

      const [parkedVehicles, setParkedVehicles] = useState("");

      const [parkingQueque, setParkingQueue] = useState("");

      const addVehicle = (e) => {

            console.log(e.size)

            if(freeSpaces[e.size] > 0){
                  setFreeSpaces({
                        ...freeSpaces,
                        [e.size]: freeSpaces[e.size] - 1
                  })

                  setId(id + 1)

            }

            // freeSpaces[e] > 0
            //       ? setFreeSpaces({
            //               ...freeSpaces,
            //               [e]: freeSpaces[e] - 1,
            //         })
            //       : console.log("AGREGAR A LA COLA");
      };

      console.log(freeSpaces, 'ID', id)

      return (
            <div className="App">
                  <section className="GUI-interface">
                        <div className="buttons">
                              <button
                                    onClick={(e) => addVehicle({
                                          size: 1, parked: "", id
                                    })}
                              >
                                    Motorcycle
                              </button>
                              <button onClick={(e) => addVehicle({
                                          size: 2, parked: "", id
                                    })}>
                                    Sedan
                              </button>
                              <button onClick={(e) => addVehicle({
                                          size: 3, parked: "", id
                                    })}>
                                    Truck
                              </button>
                        </div>
                        <div className="freeSpaces">
                              small: {freeSpaces.small}
                              medium: {freeSpaces.medium}
                              large: {freeSpaces.large}
                        </div>
                  </section>
                  <section className="parking-queue">
                        Queue: {parkingQueque}
                  </section>
            </div>
      );
}

export default App;
